Concept ACK, but I suggest remove this `LogPrintf` (or `LogPrint(DEBUG_CATEGORY, …)`:ing it instead):

```
    if (gArgs.GetArg("-rpcpassword", "") == "")
    {
        LogPrintf("No rpcpassword set - using random cookie authentication.\n");
```

Generally I think it is bad usability to do "you're using the defaults - everything is normal" logging. It is when _not_ using the defaults the user may want to be informed about doing so :)
